// src/components/Bio.js
import React from 'react';
import './Bio.css';
import Particles from './Particles';

const Bio = () => {
  return (
    <section id="bio" className="bio">
      <Particles />
      <div className="bio-content" style={{ zIndex: 1, position: 'relative' }}>
        <h1>Danny Garcia</h1>
        <p>
          Senior frontend engineer with over a decade of experience building nice, engaging web solutions.
        </p>
      </div>
    </section>
  );
};

export default Bio;
